import React from "react";
import "./App.css";

class App extends React.Component {

  searchResult() {
    this.setState(state => ({
      isToggleOn: !state.isToggleOn
    }));
  }

  render() {
    return (
      <div className={"App"}>
        <div className={"InputWrapper"}>
          <input placeholder={"Enter a value..."} />
          <button onClick={this.searchResult}>Submit</button>
        </div>
      </div>
    );
  }
}

export default App;
